    constructor() {
        this.values = {
            year: 2020,
            term: 'Summer',
            defaultCampus: 'UTM',
            defaultDepartment: 'Computer Science',
            hiring: true,
            cacheInvalidate: 3600000,
            unionCopy:
                "Our fall term courses are in need of teaching assistants. General duties, if not specified, include conducting a one-hour weekly tutorial session for approximately 30 students, and grading students' work. Appointments are generally for a total of 54 hours per term. The term begins January and ends at the beginning of April. Note that the St George campus, Scarborough campus (UTSC) and Mississauga (UTM) offer DCS teaching assistantships. Positions on all three campuses are considered to satisfy graduate funding guarantees as well as establish First Appointment(s) and satisfy Subsequent Appointment(s) for the Department of Computer Science resulting from Article 16:06 of the Collective Agreement.\n\nThe current wage rate is $44.44/hour, plus vacation pay, as specified in Article 26 of the CUPE 3902 Unit 1 Collective Agreement. Please note that should rates stipulated in the new Collective Agreement vary from rates stated in this posting, the new rates stated in the Collective Agreement shall prevail.\n\nThe Chair's authorized designate shall make any and all offers of employment on behalf of the Department of Computer Science. No other offer or notice of the outcome of applications is authorized by the Department.\n\nFinal availability of positions is contingent upon final course determinations, enrolment, budgetary considerations and the final determination of assignments flowing from Article 16:06 of the collective agreement.\n\nFor all of these positions, excellent written and spoken English is an essential requirement (unless explicitly indicated otherwise).\n\nThe application deadlines are as follows:\n\nUTM positions - 5:00 pm on March 21, 2021.\n\nPlease update your Profile as part of submitting an application.",
