/* eslint-disable max-classes-per-file */
const BaseRoute = require('./BaseRoute');
const { methods } = require('../../config/consts');

class GETRoute extends BaseRoute {
    constructor(...path) {
        super(methods.GET, ...path);
    }

    bindTo(router) {
        router.get(this.path, this.validation, this.execute());
    }
}

class POSTRoute extends BaseRoute {
    constructor(...path) {
        super(methods.POST, ...path);
    }

    bindTo(router) {
        router.post(this.path, this.validation, this.func, this.execute());
    }
}

class PUTRoute extends BaseRoute {
    constructor(...path) {
        super(methods.PUT, ...path);
    }

    bindTo(router) {
        router.put(this.path, this.validation, this.execute());
    }
}

class PATCHRoute extends BaseRoute {
    constructor(...path) {
        super(methods.PATCH, ...path);
    }

    bindTo(router) {
        router.patch(this.path, this.validation, this.execute());
    }
}

class DELETERoute extends BaseRoute {
    constructor(...path) {
        super(methods.DELETE, ...path);
    }

    bindTo(router) {
        router.delete(this.path, this.validation, this.execute());
    }
}

module.exports = {
    GETRoute,
    POSTRoute,
    PUTRoute,
    PATCHRoute,
    DELETERoute,
};

