/* eslint-disable camelcase */
const path = require('path');
const express = require('express');
const { body, buildCheckFunction } = require('express-validator');
const { states, validTerms } = require('./config/consts');
const logger = require('./config/logger');
const Options = require('./config/options/opt_wrapper');

function getOptions() {
	return Options.getOptions();
}

function updateOptions(newOptions) {
	return Options.putOptions(newOptions);
}

function toTitleCase(str) {
	return str.replace(/\w\S*/g, (txt) => txt.charAt(0).toUpperCase() + txt.substr(1).toLowerCase());
}

function pad(num, size) {
	let padding = `${num}`;
	while (padding.length < size) padding = `0${padding}`;
	return padding;
}

function currentTerm() {
	return {
		year: getOptions().year,
		term: getOptions().term,
	};
}

function generateFullCode(term, year) {
	let termCode = 0;
	switch (term) {
	case validTerms.Fall:
		termCode = 9;
		break;
	case validTerms.Winter:
		termCode = 1;
		break;
	case validTerms.Summer:
		termCode = 5;
		break;
	default:
		termCode = -1;
	}
	if (termCode === -1) return -1;
	return year + pad(termCode, 2);
}

function invertFullCode(rawYearCode) {
	const year = Math.floor(parseInt(rawYearCode, 10) / 100);
	const termcode = parseInt(rawYearCode, 10) % 100;
	let term = null;
	switch (termcode) {
	case 9:
		term = validTerms.Fall;
		break;
	case 1:
		term = validTerms.Winter;
		break;
	case 5:
		term = validTerms.Summer;
		break;
	default:
		term = null;
	}
	if (term === null) return null;
	return {
		year,
		term,
	};
}

function driveWrap(authFcn, fail) {
	return (req, res, next) => {
		if (authFcn(req)) {
			next();
		} else if (fail) {
			fail(res);
		} else res.status(401).sendFile(path.resolve(__dirname, 'build', '401.html'));
	};
}

function authenticateWrap(app) {
	app.use(driveWrap((req) => req.session.authenticated));
}

function authorizeWrap(app, ...flags) {
	const roles = new Set(flags);
	app.use(driveWrap((req) => roles.has(req.session.role)));
}

function authorizeRedirect(app, ...flags) {
	const roles = new Set(flags);
	app.use(
		driveWrap(
			(req) => roles.has(req.session.role),
			(res) => res.redirect('/utap/api/utorid'),
		),
	);
}

function currentTermCode() {
	return parseInt(generateFullCode(getOptions().term, getOptions().year), 10);
}

function buildEndpoints(app, route) {
	const router = express.Router();
	const {
		mountPath, // path on which the router is mounted
		endpoints, // the array of JS objects representing each endpoint
		initalize, // the initalization function
	} = route;
	if (initalize) initalize(router); // call initalizer
	endpoints.forEach((endpoint) => {
		endpoint.bindTo(router);
	});
	// mount router onto the path of the server
	app.use(mountPath, router);
	return router;
}

function stringListValidation(list) {
	return list.map((v) => body(v).exists({ checkNull: true }).isString());
}

function stringSchemeValidation(list) {
	return list.map((v) => {
		let validator = body(v.key).exists({ checkNull: true }).isString();
		if (v.message) {
			validator = validator.custom((value) => {
				if (value.length > v.max) {
					throw new Error(v.message);
				}
				return true;
			});
		} else if (v.max) {
			validator = validator.isLength({ max: v.max });
		}
		if (v.custom) {
			validator = validator.custom(v.custom);
		}
		return validator;
	});
}

function intListValidation(list) {
	return list.map((v) => body(v).exists({ checkNull: true }).isNumeric());
}

function isInteger(v) {
	// eslint-disable-next-line eqeqeq
	if (parseInt(v, 10) != v) return false;
	return true;
}

function areIntegers(object, ...keys) {
	for (let i = 0; i < keys.length; i += 1) {
		const value = parseInt(object[keys[i]], 10);
		// eslint-disable-next-line eqeqeq
		if (value != object[keys[i]]) return false;
		if (value < 0) return false;
	}
	return true;
}

function notIntegers(object, ...keys) {
	for (let i = 0; i < keys.length; i += 1) {
		const value = parseInt(object[keys[i]], 10);
		// eslint-disable-next-line eqeqeq
		if (value != object[keys[i]]) return keys[i];
		if (value < 0) return keys[i];
	}
	return false;
}

/**
 * KRISH SEND HELP
 * @param {*} a
 * @param {*} b
 * @param {*} tags
 */
function sortby(a, b, ...tags) {
	for (let i = 0; i < tags.length; i += 1) {
		const tag = tags[i];
		let ret = null;
		if (a[tag] > b[tag]) {
			ret = 1;
		}
		if (a[tag] < b[tag]) {
			ret = -1;
		}
		if (typeof a[tag] === 'string') ret = -ret;
		if (ret) return ret;
	}
	return 0;
}

function validateKey(src, valid, key) {
	if (src[key] in valid) return true;
	throw new Error(`Invalid value ${src[key]} in body`);
}

function Handle404(req, res) {
	res.status(404).sendFile(path.resolve(__dirname, 'build', '404.html'));
}

function Handle400(req, res) {
	res.status(400).sendFile(path.resolve(__dirname, 'build', '400.html'));
}

function Handle406(err, req, res) {
	res.status(406).sendFile(path.resolve(__dirname, 'build', '400.html'));
}

function mapReduceList(map, object, key) {
	if (object[key] in map) {
		map[object[key]].push(object);
	} else {
		map[object[key]] = [object];
	}
}

/*
Returns a value from the const `states`.
Compares the two term codes to see which is older
*/
function compareTerm(sourceTermcode, targetTermcode) {
	const source = invertFullCode(sourceTermcode);
	const target = invertFullCode(targetTermcode);
	// eslint-disable-next-line eqeqeq
	if (sourceTermcode == targetTermcode) return states.SAME;
	if (source.year < target.year) {
		return states.OLDER;
	}
	if (source.year > target.year) {
		return states.NEWER;
	}

	// Year must be the same
	if (source.term === validTerms.Winter) {
		// If the source is winter, this means the target must be summer or fall, i.e. newer
		// so we are older
		return states.OLDER;
	}
	if (source.term === validTerms.Fall) {
		// If the source is fall, this means the target must be summer or winter, i.e. older
		// so we are newer
		return states.NEWER;
	}
	const sourceTerm = parseInt(sourceTermcode, 10) % 100;
	const targetTerm = parseInt(targetTermcode, 10) % 100;
	// I had to use row reduction for this...
	// But source must be summer, so if target is larger (09), it's fall
	// so we are older. If smaller, it's winter, so we are newer (i.e. later).
	return sourceTerm < targetTerm ? states.OLDER : states.NEWER;
}

function stringFormat(...args) {
	let a = this;
	args.forEach((v, i) => {
		a = a.replace(`{${i}}`, v);
	});
	return a;
}

function parseIntValues(...values) {
	return values.map((v) => parseInt(v, 10));
}

function isEnum(value, enumType) {
	if (value in enumType) return true;
	return false;
}

function injectLogger(req, res, next) {
	logger.log('http', `Incoming - ${req.method} ${req.originalUrl} - ${req.ip}`, {});
	res.on('finish', () => {
		const usersess = {};
		if (req.session) {
			Object.keys(req.session)
				.filter((v) => req.session[v])
				.forEach((v) => {
					usersess[v] = req.session[v];
				});
		}
		delete usersess.cookie;
		// eslint-disable-next-line no-underscore-dangle
		delete usersess.__lastAccess;
		logger.log('http', `${res.statusCode} - ${req.method} ${req.originalUrl} - ${req.ip}`, {
			usersess,
			statusMessage: res.statusMessage,
		});
	});
	next();
}

function corsOptionsDelegate(allowlist) {
	return (req, callback) => {
		let corsOptions;
		if (allowlist.indexOf(req.header('Origin')) !== -1) {
			corsOptions = { origin: true };
		} else {
			corsOptions = { origin: false };
		}
		callback(null, corsOptions);
	};
}

function arrayToString(array) {
	let psqlArray = '{';
	array.forEach((item) => {
		// eslint-disable-next-line prefer-template
		psqlArray += '\'' + item + '\'';
	});
	psqlArray += '}';
	return psqlArray;
}

// Adds a format function to the prototype for the String type.
// eslint-disable-next-line no-extend-native
String.prototype.format = stringFormat;

module.exports = {
	getOptions,
	updateOptions,
	generateFullCode,
	invertFullCode,
	authorizeWrap,
	currentTermCode,
	authorizeRedirect,
	buildEndpoints,
	currentTerm,
	stringListValidation,
	intListValidation,
	sess: buildCheckFunction(['session']),
	sortby,
	toTitleCase,
	areIntegers,
	logger,
	injectLogger,
	validateKey,
	isInteger,
	Handle404,
	authenticateWrap,
	mapReduceList,
	compareTerm,
	parseIntValues,
	isEnum,
	notIntegers,
