/* eslint-disable class-methods-use-this */
const { validationResult } = require('express-validator');

const logger = require('../../config/logger');
const catalog = require('../../config/message_catalog');

function formValidateStatusMsg(error) {
	return `Error in ${error.param}: ${error.msg}`;
}

function badValidation(response, errors) {
	const msg = formValidateStatusMsg(errors.array()[0]);
	response.statusMessage = msg;
	response.status(400).end();
}

function setDownload(res, downloadObj) {
	res.download(downloadObj.path, downloadObj.name, downloadObj.cb);
	return res;
}

class Route {
	constructor(method, ...path) {
		this.func = [];
		this.method = method;
		this.path = `/${path.join('/')}`;
		this.validation = [];
		this.fail = badValidation;
		this.handler = () => {
			logger.warn('Not implemented', { path: this.path, method: this.method });
			return { status: 501 };
		};
	}

	withValidation(validationList) {
		this.validation = [...this.validation, validationList];
		return this;
	}

	withHandler(handler) {
		this.handler = handler;
		return this;
	}

	withMiddleWare(func) {
		this.func = [...this.func, func];
		return this;
	}

	withFail(fail) {
		this.fail = fail;
		return this;
	}

	validateRequest(request, response) {
		const errors = validationResult(request);
		if (!errors.isEmpty()) {
			// if any validation fails
			logger.log('warn', `Bad request made to ${this.path}`, { errors, method: this.method });
			this.fail(response, errors); // generate status message for validation error
			return true;
		}
		return false;
	}

	execute() {
		return async (request, response) => {
			try {
				if (this.validateRequest(request, response)) return;
				const {
					json, // JSON object to be returned (optional)
					status, // HTTP status code
					// file, // File to be returned (optional)
					download, // The object required to send a download to the client.
					header, // JS object with headers to be returned (optional)
					deleteHeader, // JS object with headers to be deleted (optional)
					message, // Status message to be returned (optional)
					redirect, // The path to redirect the response to
					send, // Direct content to be sent to the user.
				} = await this.handler(request);
				if (header) await response.set(header);
				if (deleteHeader) {
					deleteHeader.forEach((clear) => {
						response.clearCookie(clear);
					});
				}
				// For sending user to our login page
				// if (header && header.role) response.redirect("/utap/utoridLogin").send(status)
				if (send) response.send(send);
				else if (redirect) response.redirect(redirect);
				// else if (file) response.status(status).sendFile(file);
				else if (download) setDownload(response, download);
				else if (json !== undefined) response.status(status).json(json);
				else {
					// only status message being send back
					let statusMessage = message;
					if (message === undefined) {
						// no message sent by callback
						if (status in catalog) statusMessage = catalog[status];
						// look up based on status
						else {
							// status not found in catalog
							logger.log('error', 'Lookup statusMessage failed', { status });
							statusMessage = catalog.unimplemented_message;
						}
					}
					// set appMsg attr to be status message, and set js response to be object.
					response.statusMessage = statusMessage;
					response.status(status).end();
				}
			} catch (error) {
				logger.log('error', 'Generic error, not handled', {
					body: request.body,
					session: request.session,
				});
				// eslint-disable-next-line no-console
				console.log(error);
				response.statusMessage = catalog['500'];
				response.status(500).end();
			}
		};
	}

	bindTo() {
		logger.error('Invalid Method Call - BaseRoute');
		throw new Error('Invalid Method Call - BaseRoute');
	}
}

module.exports = Route;
